import './AboutMe.css';

const AboutMe = React.forwardRef((props, ref)=>{

    return (
        <div className='column'>
            <div className='box2' ref={ref}>
                {/* <div data-id="1" data-aos="fade-up"> */}
                <div className='aboutMe'>About Me</div>

                <div display='flex' flex-direction='row' align-items='center' justify-content='center'>
                    <div className='text'>
                        I am Chianne Connelly. I just graduated from Georgia Tech and began my career as
                         a Software Engineer. 
                    </div>
                    <div className='vid'>
                        <iframe margin='auto' width="560" height="315" src="https://www.youtube.com/embed/Nm_f_44ZgLM"
                        frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" 
                        allowfullscreen></iframe>
                    </div>
                </div>

                 {/* </div> */}
            </div> 
        </div>
    )
}) 

export default AboutMe;
